SELECT DISTINCT ?village ?villageName
WHERE {
  # Get Blackbough's geometry
  dbr:Blackbough geo:hasGeometry ?blackboughGeom .
  ?blackboughGeom geo:asWKT ?blackboughWKT .

  # Find all settlements
  ?village a witcher:Settlements ;
           rdfs:label ?villageName ;
           geo:hasGeometry ?villageGeom .
  ?villageGeom geo:asWKT ?villageWKT .

  # Filter for villages within Blackbough's boundaries
  FILTER(geof:sfWithin(?villageWKT, ?blackboughWKT))
}

SELECT DISTINCT ?settlement ?settlementName
WHERE {
  ?settlement a witcher:Settlements ;
              rdfs:label ?settlementName ;
              geo:hasGeometry/geo:asWKT ?settlementGeometry .

  # Get Blackbough's geometry
  dbr:Blackbough geo:hasGeometry/geo:asWKT ?blackboughGeometry .

  # Filter settlements within Blackbough
  FILTER(geof:sfWithin(?settlementGeometry, ?blackboughGeometry))

  # Check if region is Crow's Perch
  ?settlement witcher:region dbr:Crow_s_Perch_region .
}

SELECT ?sign ?signLabel WHERE {
