        rdfs:label ?signLabel ;
        geo:hasGeometry ?signGeo .

  dbr:Codgers_Quarry geo:hasGeometry ?codgerGeo .
  dbr:Ard_Skellig geo:hasGeometry ?ardGeo .

  FILTER(geof:sfWithin(?signGeo, ?codgerGeo) && geof:sfWithin(?signGeo, ?ardGeo))
}

